description:
The talented collaborators The Blackwater Project, Bill Thomas and Mark Moffre launched a musical group over the internet without ever meeting. Their music has been met with rave reviews. The Blackwater Project records the music along with his infectious grooves. Bill Thomas adds his screaming lead guitar and production and Mark Moffre adds his lyrics and vocals. Joint them as they journey from the sky to deliver you the goods. Support them as they make non corporate music. Your support will help make them a name in the underground. They are very grateful of your support. Also check out www.acidplanet.com and search each artist for their own unique flavor. Also, email them and say HIGH!
